" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Frontotemporal dementia: Clinical features and diagnosis",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?12/20/12618/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?12/20/12618/contributors\">",
"     Christopher Randolph, PhD, ABPP-CN",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
