var title_f12_20_12620="ATS severe asthma criteria";
var content_f12_20_12620=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F68983&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F68983&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ATS workshop consensus for definition of severe/refractory asthma*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        The definition of refractory asthma requires one or both major criteria and two minor criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Major criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        To achieve control to level of mild-moderate persistent asthma:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1. Treatment with continuous or near continuous (&ge;50 percent of year) oral glucocorticoids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2. Treatment with high-dose inhaled glucocorticoids:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent3\">",
"        Beclomethasone &gt;1260 mcg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent3\">",
"        Budesonide &gt;1200 mcg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent3\">",
"        Fluticasone &gt;880 mcg/day",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Minor criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1. Requirement for additional daily treatment with a controller medication, eg, long-acting &beta;-agonist, theophylline, or leukotriene antagonist",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2. Asthma symptoms requiring short-acting &beta;-agonist use on a daily or near daily basis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3. Persistent airflow limitation (FEV1 &lt;80 percent predicted; diurnal peak expiratory flow variability &gt;20 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        4. One or more urgent care visits for asthma per year",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        5. Three or more oral glucocorticoid bursts per year",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        6. Prompt deterioration with &le;25 percent reduction in oral or inhaled glucocorticoid dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        7. Near-fatal asthma event in the past",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Requires that other conditions have been excluded, exacerbating factors treated, and patient believed to be generally adherent.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted with permission from: Wenzel SE, Fahy JV, Irvin CG, et al. Proceedings of the ATS Workshop on Refractory Asthma: current understanding, recommendations and unanswered questions. Am J Respir Crit Care Med 2000; 162:2341-51.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
